import logo from '../../assets/images/logo1.png';
import { useState, useEffect } from 'react'
import { useDispatch } from 'react-redux';
import { useNavigate } from 'react-router-dom';

function RegisterRes() {
    const [form, setForm] = useState({
        email: "",
        address: "",
        username:"",
        title: "",
        phone: ""
    });
    const dispatch = useDispatch();
    const navigate = useNavigate();

    const handleSubmit = async(e)=>{
        const {email, password, username, title, phone} = form;
        e.preventDefault();
        console.log(form)
        // const action = await login(email, password);
        // dispatch(action);
        // if(action.type === LOGIN_SUCCESS){
        //     if(action.payload.roleCode !== "ROLE_USER") navigate("/restaurant");
        //     else navigate("/register/"+action.payload.id);
        // }
    }

    function handleForm(e){
        setForm({...form, [e.target.name]: e.target.value});
    }

    return ( 
        <div className="login">
        <div className="login-box">
            <div className="login-logo">
                <img src={logo} alt="Restaurant Reservation"/>
            </div>
            <div className="card">
                <div className="card-body">
                <p className="login-box-msg">Register the restaurant account</p>
                <form 
                onSubmit={(e)=>handleSubmit(e)}
                >
                    <div className="input-group mb-3">
                        <input type="text" 
                        onChange={handleForm} 
                        name="username" className="form-control" placeholder={localStorage.getItem("username")} disabled/>
                        <div className="input-group-append">
                            <div className="input-group-text">
                                <span className="fas fa-user"></span>
                            </div>
                        </div>
                    </div>
                    <div className="input-group mb-3">
                        <input type="text" 
                        onChange={handleForm} 
                        name="email" className="form-control" placeholder={localStorage.getItem("email")} disabled/>
                        <div className="input-group-append">
                            <div className="input-group-text">
                                <span className="fas fa-user"></span>
                            </div>
                        </div>
                    </div>
                    <div className="input-group mb-3">
                        <input type="text" 
                        onChange={handleForm} 
                        name="title" className="form-control" placeholder="Restaurant name"/>
                        <div className="input-group-append">
                            <div className="input-group-text">
                                <span className="fas fa-user"></span>
                            </div>
                        </div>
                    </div>

                    <div className="input-group mb-3">
                        <input type="text" 
                        onChange={handleForm} 
                        name="phone" className="form-control" placeholder="Phone"/>
                        <div className="input-group-append">
                            <div className="input-group-text">
                                <span className="fas fa-lock"></span>
                            </div>
                        </div>
                    </div>
                    <div className="input-group mb-3">
                        <input type="text" 
                        onChange={handleForm} 
                        name="address" className="form-control" placeholder="Address"/>
                        <div className="input-group-append">
                            <div className="input-group-text">
                                <span className="fas fa-lock"></span>
                            </div>
                        </div>
                    </div>
                    <div className="row">
                        <div className="col-12">
                            <button type="submit" className="btn btn-primary btn-block">
                                Confirm 
                            </button>
                        </div>
                    </div>
                </form>
                </div>
            </div>
        </div>
    </div>
     );
}

export default RegisterRes;
